import React, {useState, useEffect} from 'react'
import Layout from '../components/Layout'

const Program = (props) => {
    const [className, setClassName] = useState(props.url.query.kelas);

    const [listClass, setListClass] = useState([]);

    useEffect(()=>{
        setClassName(props.url.query.kelas.touppercase)
        setListClass([
            "IT", "Design", "Others"
        ]);

        const flag = listClass.find((l)=>{return className == l})
        console.log(flag)

    }, [props.url.query.kelas])
    return(
        <Layout activeClass={props.url.pathname}>
            <h1>Program Class {className}</h1>
        </Layout>
    )
}


export default Program;
